import React from "react";
import { useLocation, useParams } from "react-router";

const User = () =>{
    const {next} = useParams();
    const location = useLocation();
    return (
        <>
        <h1>Asad Rehman! Where is Your User {next}</h1>
        <p>Your Location is {location.pathname}</p>
        </>)


}
export default User;
